INSERT INTO `post` (`id`, `title`, `content`, `date`, `imagelink`, `comment`, `link`, `username`, `category`) VALUES
(33, 'Albano Bogdo: Me “Duplex” në Tv Klan do të thyejmë rekorde', 'Albano Bogdo është një nga “bashkudhëtarët” e aktorëve të humorit që së bashku me kolegët e tij, do të jenë çdo të shtunë në ekranin e e Tv Klan me programin “Duplex”. Nëse në skenë ai shkakton të qeshura dhe batuat pa fund, në jetën e përditshme Albano është shumë serioz. Në një intervistë për tvklan.al, Albano ka rrëfyer për ardhjen në televizionin Klan, por edhe për jetën e tij private.  Si ndiheni në një televizioni të ri?  Mua më pëlqejnë sfidat e reja dhe tek Televizioni Klani ka pritshmëri shumë të larta, të cilat pritet ti thyejmë dhe do i thyejmë sepse ne kemi 9 vite që thyejmë pritshmëritë. Unë u “eksitova” shpirtërisht që do të luanim “futboll” në një stadium më të madh dhe tani po presim të shënojmë gola dhe të thyejmë rekorde. Ne tek Vizioni ishim si familje dhe kemi punuar 9 vite aty. Është si të ndërrosh shtëpi. Ne blemë një shtëpi të re dhe do pak kohë sa të fiksohesh se ku ke lënë lugët, gotat, karikusin e telefonit. Sa të mësosh me këto gjëra, pastaj gjithçka vjen natyrshëm.  Marrëdhënia juaj më aktorët e “Duplex” është po aq e fortë sa në skenë dhe jashtë saj?   Ne jemi të gjithë të barabartë dhe jemi miq shumë të mirë në jetët tona. Dikush më shumë, dikush më pak, por ne jemi miq dhe jashtë saj. Ne marrim urdhra vetëm nga Turi.', '2022-06-24', 'https://tvklan.al/wp-content/uploads/2018/09/albano-scaled.jpg.webp', 'Kam që në 2 Qershor të vitit 2014 që nuk pi më alkool sikur të përmbyset bota. Nuk më pihet më. Edhe kur bëra 30 vjetorin, të gjithë pinë u bënë tapë dhe unë piva vetëm sprite. As për vitin e ri, as për 1 Majin, për asnjë festë. Kjo tregon vendosmërinë dhe karakterin. Kam 4 vite që nuk jam tunduar asnjëherë. Kur ulem me njerëz që pinë alkool me shpifet.', 'https://tvklan.al/albano-bogdo-me-duplex-ne-tv-klan-do-te-thyejme-rekorde/', 'Ari Dikolli', 'Fashion'),
(34, 'Italia barazon me Gjermaninë', 'Italia barazoi 1 – 1 me Gjermaninë më sfidën e parë të Ligës së Kombeve.  Pelegrini shënoi për italianët më të 70′, por Kimish barazoi 3 minuta më vonë.  Po në Grupin 3, Hungaria befasoi Anglinë, duke e mundur 1 – 0 në sfidën e zhvilluar në Budapest. Takimi u vendos nga një penallti në pjesën e dytë. Me këto rezultate Hungaria kryeson grupin 3', '2022-06-17', 'https://tvklan.al/wp-content/uploads/2022/06/125273424_gettyimages-1401045376.jpg', 'Hungaria fiton me Anglinë dhe merr vendin e parë', 'https://tvklan.al/italia-barazon-me-gjermanine/', 'Ari Dikolli', 'sport'),
(35, 'MARIN', 'BIOGRAFIA: Marin është një këngëtar dhe autor këngësh i njohur dhe muzika ku identifikohet më shumë është ajo hip-hop. Emri tij eshte Maringlen Malaj nga Hasi dhe jeton ne Has. Ai filloi karrieren e tij ne nje moshe te vogel dhe ju fut rruges se hip hopit dhe ka talentin dhe deshiren qe e bashkon ai esht 20 vjec ai pati nje projekt muzikor shum te mir kengen Xhan qe e cila u publikua nga studio REDBOX Entertemen e cila pati nje sukses te mjaft te mir per Marinin. Ai ka qene pjestare ne festivalin Shkodra Fest i cili fitoi me kengen Kingin ne vitin 2014. Tani aktu...', '2022-06-04', 'https://www.teksteshqip.com/img_upz/galeri_full/191/191146.jpg', 'Vendlindja:Has', 'https://www.teksteshqip.com/t-n-t', 'Ari Dikolli', 'Fashion'),
(36, ' Sezoni turistik nis me rrugë të bllokuara', 'Radhë kilometrike dhe qindra automjete të bllokuara në mes të vapës. Kjo ka qenë situata me të cilën janë përballur mijëra qytetarë pasditen e kësaj të diele kur janë kthyer nga plazhet.  Me mijëra qytetarë kanë mbetur të bllokuar në gati të gjitha akset rrugore që lidhin zonat bregdetare me qytete kryesore të vendit. Situata më problematike ka qenë në dalje të Vlorës sidomos pjesën drejt Orikumit.  Shkak për bllokimin është bërë edhe zvarritja e punimeve për rehabilitimin e këtij aksi prej 9 vjetësh dhe që ende nuk kanë përfunduar. Po kështu probleme ka pasur edhe brenda në qytet sidomos në zonën e Lungomares.', '2022-06-11', 'https://tvklan.al/wp-content/uploads/2022/06/trafiku-OK-300x169.jpg', '“Një numër i lartë automjetesh i janë drejtuar hyrjes së Tiranës, kryesisht pushues të ardhur nga qyteti bregdetar i Durrësit. Ky fluks ka krijuar herë pas here episode me trafik të shtuar.”', 'https://tvklan.al/sezoni-turistik-nis-me-rruge-te-bllokuara/', 'Ari', 'dailynews'),
